import React from "react";
import { useNavigate } from "react-router-dom";

function Header({ nupirkta }) {
  const nav = useNavigate();

  function toUpload() {
    nav("/uploadProduct");
  }
  function toAllProd() {
    nav("/allProducts");
  }
  function toProfile() {
    nav("/profile");
  }
  function toNupirkta() {
    nav("/myProducts");
  }

  return (
    <div className="footer">
      <h3 onClick={toProfile}>Profile</h3>
      <h3>Money: 300$</h3>
      <h3 onClick={toAllProd}>All products</h3>
      <h3 onClick={toUpload}>Upload Product</h3>
      <h3 onClick={toNupirkta}>My products:({nupirkta.length})</h3>
    </div>
  );
}

export default Header;
